import styled from 'styled-components'

export const ContainerSubNav = styled.div`
  padding-top: 1.75rem;
  background: #0d1117;
  border-bottom: 1px solid #256c010;

`

export const ContainerSub = styled.div`

  max-width: 1280px;
  margin: 0 auto;
  color: white;


  display: flex;
  align-items: center;

  div {
    width: 19.5rem;
  }

  nav {
    padding: 0 1rem;
  }
  ul {
    list-style: none;
    display: flex;
    align-items: center;

    li {
      padding: .5rem 1rem;
      color: #c9d1d9;
      font-size: 0.9375rem;
    }

  }

`
